import { View, Text, StyleSheet } from 'react-native'
import React from 'react'

const TopBarComp = () => {
  return (
    <View style={styles.container}>
      <Text>
        TopBarComp
      </Text>
    </View>
  )
}

const styles = StyleSheet.create({
    container: {
        height: '5%',
        alignContent: 'center',
        alignSelf: 'center',
        marginVerticalAlign: 'middle',
        
    },
})

export default TopBarComp
